import './App.css';
import { usersAPI } from './api/API'

function App() {

	let onclick = () => {
		usersAPI.getUsers()
			.then(response => console.log(response.data))
	}

	return (
		<div className="App">
			<button onClick={onclick}>123</button>
		</div>
	);
}



export default App;
